import React from 'react';
// import PropTypes from 'prop-types';
// import { connect, useSelector } from 'react-redux';
// import { compose } from 'redux';
// import { Form, Field } from 'react-final-form';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faFacebookF } from '@fortawesome/free-brands-svg-icons';
// import { Modal } from 'react-bootstrap';
// import SocialButton from 'components/SocialButton';
import Header from 'components/Header';
import Footer from 'components/Footer';
// import * as CONSTANTS from 'common/constants';
// import FormStateToRedux from 'common/util/FormStateToRedux';
// import SocialLogin from 'containers/Auth/SocialLogin';
// import {
//   signIn as signInAction,
//   googleLogin as googleLoginAction,
//   isLoadingSignIn,
//   selectError,
// } from 'containers/Auth/authSlice';

export default function ResetPassword() {
  return (
    <>
      <Header />

      <section className="login pt-5">
        <div className="container pt-5 pb-4">
          <div className="row pt-4 align-items-center">
            <div className="col-md-12">
              <div className="form">
                <form className="ng-pristine ng-valid">
                  <div className="login_left">
                    <div className="">
                      <h2 className="mb-4">Reset Password</h2>
                      <div className="form-group">
                        <input
                          type="Password"
                          className="form-control"
                          value=""
                          required
                          placeholder="Password"
                          name="password"
                          minLength="6"
                          maxLength="20"
                        />
                        <p className="text-danger">
                          <span if="Password.errors.required">The Password is required.</span>
                        </p>
                      </div>
                      <div className="form-group">
                        <input
                          type="Password"
                          className="form-control"
                          value=""
                          required
                          placeholder="Confirm Password"
                          name="confirmPass"
                        />
                        <p className="text-danger">
                          <span if="confirmPass.errors.required">
                            The Confirm Password is required.
                          </span>
                        </p>
                      </div>
                      <div className="form-group mb-0 mt-4">
                        <button type="submit" className="btn btn-theme">
                          Submit
                        </button>
                      </div>
                    </div>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
        <div className="login_right">
          <img src="assets/img/sing_up.png" alt="Reset password" />
        </div>
      </section>
      <Footer />
    </>
  );
}
